import{d,o as m,c as g,a as t,t as u,r as b,n as v,b as y,e as k,w as h,u as e,f as q,g as f}from"./index-60fff16e.js";import{_ as p}from"./Col.vue_vue_type_script_setup_true_lang-1228b266.js";const z="/assets/news1-e9cb7773.jpg",x="/assets/news2-0f9d6a0e.jpg",w="/assets/news3-d2803692.png",_="/assets/news4-8740c047.png",I={"data-aos":"flip-left",class:"text-2xl py-5 w-2/3 text-center text-grenn font-bold uppercase"},T=d({__name:"Wrapper",props:{label:String,styles:String},setup(a){return(i,c)=>(m(),g("div",{class:v(`w-full flex items-center flex-col ${a.styles}`)},[t("h1",I,u(a.label),1),b(i.$slots,"default")],2))}}),A=y("dataStore",{state:()=>({data:[{id:1,title:"Islom Karimov nomidagi Toshkent davlat texnika universitetida targʻibot tadbiri",img:z,text:" Tadbirda soʻzga chiqqanlar yangilanayotgan Konstitutsiyaning mazmun-mohiyati, unga kiritilgan yangi qoʻshimchalar, ularning ahamiyati va dolzarbligi haqida gapirib, yangilanayotgan Konstitutsiyadagi oʻzgartirishlarning barchasi mamlakatimiz rivoji, xalqimizning ertangi farovon hayoti, jamiyat va davlat taraqqiyotini taʼminlashda mustahkam huquqiy asos boʻlib xizmat qilishini taʼkidladilar."},{id:2,title:"O‘zbekiston-Yaponiya yoshlar innovatsiya markazida Iqtidorli talaba yoshlarga bag’ishlangan tadbir",img:x,text:`Joriy yilning 28-aprel kunlari O‘zbekiston-Yaponiya yoshlar innovatsiya markazida Iqtidorli talaba yoshlarga bag’ishlangan “Fan va texnika taraqqiyotida intellektual yoshlarning o’rni” mavzusida respublika ilmiy-amaliy anjumani bo’lib o’tdi. Ushbu anjumanda Ilmiy ishlar va innovatsiyalar bo’yicha prorektor, fakultet dekanlari, kafedra mudirlari va 150 dan ortiq iqtidorli talabalar ishtirok etishdi. Anjuman ochilish marosimini Ilmiy ishlar va innovatsiyalar bo’yicha prorektor S.B.Donayev Rektor tabrik so’zini professor-o’qituvchi va talabalarga yetkazdi hamda Iqtidorli talabalarning ilmiy-tadqiqot ishlarini tashkil etish bo’limi boshlig’i talaba yoshlarga bo’lishi kutilayotgan Prizedent va nomdor stipendiyalar, Technoways, “Bo’lajak olim”, “Akademik harakatchanlik”, “Mirzo Ulug’bek vorislari” hamda boshqa turli xil tanlovlar haqida talabalar kerakli tushunchalar berdi va talabalarni ushbu tanlovlarga faol ishtirok etishiga chaqirdi.
        Anjuman davomida Isroil texnika universiteti talabasi Abdullah Watted o’zining qiziqarli ma’ruzasi bilan zoom orqali qatnashdi va universitetimizning iqtidorli talabalari o’zlarining qiziqarli ma’ruzalari bilan qatnashdi va anjuman yakunida Mashinasozlik dekani Sh.Sultanova anjumanda o’z ma’ruzalari bilan qatnashgan va faol ishtirok etgan talabalarga universitet rahbariyatining esdalik sovg’a va sertifikatlarini topshirdilar.
         Ushbu anjumanda respublika bo’yicha 400 dan ortiq iqtidorli talabalarni o’zlarining ilmiy maqolalari bilan qatnashishdi..`},{id:3,title:`O'quvchi yoshlar, talabalar, yosh o'quvchilar va korhonalar mutahassislari uchun robotics bo'yicha XALQARO TANLOV "ROBOT.Uz-2023"`,img:w,text:`Islom Karimov nomidagi Toshkent davlat texnika universiteti 2023-yil 16-17-May kunlari robotika iqtidorli oʻquvchi va talabalar, yosh oʻquvchilar, olim va mutahassislar uchun "ROBOT.Uz-2023" xalqaro tanlovi bulib utishi haqida xabar beradi. Xalqaro tanlovni o'tkazishdan kuzlangan maqsadli robototexnika sohasidagi iqtidorli yoshlarning ilmiy-texnikaviy izhodini ommalashtirish, muxandislik kasblarini nufuzini oshirish, yoshlarning innovation va zamonaviy texnologiyalar sohasiga qiziqishini ra g'alabadan iborat. Tanlovda o'quvchilari, talabalar, o'quvchi va yosh maktablar, korkhonalarning robotlashtirilgan ishlanmalar va sohani ommalashtirish bilan shug'ullanayotgan yosh mutahassislari ishtirok etishlari mumkin. Musobakalar 9 yoshdan 15 ta bulgan o'kuvchilar va 16 yoshdan 25 ta bulgan yoshlar o'rtasida o'tkazilady. ROBOT.Uz-2023 9-15 yoshli talabalar oracida (3rd nominatsiya): - Robo-Football (har bir zhamoadan ikkita robot katnashadi) - Robot Sumo - Robotning chizik buylab harakatlanishi Har bir hududda rezerv mavjud. I, II va III o'rinlar diplomlari va qimmatbaho sovg'alar bilan taqdirlanadi`},{id:4,title:"The First International Conference on Innovative Technologies in Agri-food Chain: Problems and Perspectives (ITAC-2023)",img:_,text:"The First International Conference on Innovative Technologies in Agri-food Chain: Problems and Perspectives (ITAC-2023) is organized by Tashkent State Technical University and will be held in Tashkent, Uzbekistan during May 25-26, 2023. ITAC is going to be one of the leading international conferences in Central Asia for presenting novel and fundamental advances in the fields of Agriculture. It also serves to foster communication among researchers, academicians, students, and practitioners working in a wide variety of scientific areas with a common interest in improving Agriculture related technologies and mechanisms. With members from around the world focused on learning about Agriculture and its advances; this is the best opportunity to reach the largest assemblage of participants from the Agro community. Conducted presentations, distribute information, meet with current and potential scientists, make a splash with new advancements and developments, and receive name recognition at this 2-days scientific event. World-renowned speakers, the most recent techniques, developments, and the newest updates in Agriculture are hallmarks of this conference"}]}),getters:{getnews:a=>a.data},actions:{getOneNews(a){return this.data.find(i=>i.id==a)}}}),j={class:"w-10/12 h-[600px] rounded-md my-4"},O=["src"],C={class:"w-10/12 text-xl text-start text-black"},M=d({__name:"More",setup(a){var o;const i=q(),n=A().getOneNews(+((o=i.params)==null?void 0:o.id));return(S,B)=>{var s;return m(),k(T,{label:(s=e(n))==null?void 0:s.title,styles:"bg-white"},{default:h(()=>[f(p,null,{default:h(()=>{var r,l;return[t("div",j,[t("img",{class:"w-full h-full rounded-md",src:(r=e(n))==null?void 0:r.img,alt:"img"},null,8,O)]),t("p",C,u((l=e(n))==null?void 0:l.text),1)]}),_:1})]),_:1},8,["label"])}}});export{M as default};
